import React from 'react';
import styled from "styled-components"


const Calculator = () => {
    return(
        <Wrapper>
            <AnswerBlock>
                <GetNumbers>
                    2
                </GetNumbers>
                <Answer>
                    1
                </Answer>
                <GridContainer>
                    <div>
                        <h3>AC</h3>
                        <h3>Back</h3>
                        <h3>%</h3>
                        <h3>/</h3>
                    </div>
                </GridContainer>
            </AnswerBlock>
        </Wrapper>
    );
}
const Wrapper = styled.div`
    position: relative;
    width: 400px;
    height: 600px;
    background: #cee2f3;
    border: 0.5px solid black;
    padding: 25px;
`;
const AnswerBlock = styled.div`
    height: calc(100% / 5);
    width: 100%;
    background: white;
    border: 0.5px solid black;
    display: flex;
    flex-direction: column;
    align-items: flex-end;
    justify-content: center;
    color: black;
`;
const GetNumbers = styled.div`
    width: calc(100% / 2);
    height: 40px;
    text-align: center;
    padding-top: 10px;
`;
const Answer = styled.div`
    width: calc(100% / 2);
    height: 40px;
    padding-top: 10px;
    text-align: right;
    padding-right: 15px;
`;
export default Calculator
